    getNotificationStatusLabel(warningsViewed) {
        let key = this.id.toString()
        let now = new Date();
        let closingDate = new Date(this.warningConfig.getClosingDate())
        let pauseDate = new Date(this.warningConfig.getPauseTimestamp())

        let closingLabel = (now > closingDate) ? "\n (⛔ ALERTA ENCERRADO)" : " "
        let pauseLabel = (now < pauseDate) ? "\n (⏸️ ALERTA SUSPENSO)" : " "
        

        

        if (this.fiscal_notification_status > NOTIFICATION_STATUS_ENUM.VISUALIZADA) {
            return getNotificationStatusLabel(this.fiscal_notification_status) + closingLabel + pauseLabel
        } else if (!isEmpty(warningsViewed) && Object.keys(warningsViewed).includes(key)) {
            return getNotificationStatusLabel(NOTIFICATION_STATUS_ENUM.VISUALIZADA) + closingLabel + pauseLabel
        } else {
            return getNotificationStatusLabel(this.fiscal_notification_status) + closingLabel + pauseLabel
        }
    }


